import React from 'react';
import './navegador.css';

function Navegador(){
	return(
		<nav className="navegador">
			<div className="itemNavegador">
				<a href="#">Perfil</a>
			</div>
			<div className="itemNavegador">
				<a href="#">Seguridad</a>
			</div>
			<div className="itemNavegador">
				<button>Cerrar Sessi&oacute;n</button>
			</div>
		</nav>
		);
}

export {Navegador};
